import PropTypes from "prop-types";
import PubSub from "pubsub-js";
import React from "react";
import c from "../../../constants";
import { Logger } from "../../../helpers";
import Icon from "./Icon";
import "./InfoPanelVC.scss";
import Panel from "./Panel";

/**
 * Component that renders an informative panel.
 */
export default class InfoPanelVC extends React.Component {
  // Force this component to has that nature
  static nature = "info-panel-vc";

  // Ensure received props belong to these types
  static propTypes = {
    content: PropTypes.string.isRequired,
    side: PropTypes.string.isRequired,
    pause: PropTypes.bool.isRequired,
    iconShow: PropTypes.string,
    iconHide: PropTypes.string,
    styles: PropTypes.shape({
      panel: PropTypes.shape({
        default: PropTypes.shape({
          width: PropTypes.string,
        }),
      }),
      icon: PropTypes.shape({
        default: PropTypes.shape({
          width: PropTypes.string,
        }),
      }),
    }),
    actions: PropTypes.shape({
      pausePlayer: PropTypes.func.isRequired,
      playPlayer: PropTypes.func.isRequired,
      getVideoId: PropTypes.func.isRequired,
    }).isRequired,
  };

  // Default props for not provided properties
  static defaultProps = {
    iconShow:
      "data:image/png;base64,",
    iconHide:
      "data:image/png;base64,",
    styles: null,
  };

  constructor(props) {
    super(props);

    // Initial state
    this.state = {
      display: false,
      showPanel: false,
    };
  }

  // Icon on click handler
  handleOnClick = () => {
    const { actions, pause } = this.props;
    const { showPanel } = this.state;

    // If the info panel was aimed to pause the video, check it here
    if (pause) {
      if (showPanel) {
        actions.playPlayer();
      } else {
        actions.pausePlayer();
      }
    }

    // Register event on opening info-panel
    if (!showPanel) {
      PubSub.publish(c.PUBSUB_TOPIC_GA_EVENT, {
        category: c.GA_EVENT_CATEGORY_VC,
        action: c.GA_EVENT_ACTION_VC_INFO_PANEL_OPEN,
        label: actions.getVideoId(),
      });

      // The info panel is open; save current time for later
      this.timeShowed = Date.now();
    } else if (this.timeShowed) {
      // Register event on amount of time the info-panel was open
      PubSub.publish(c.PUBSUB_TOPIC_GA_EVENT, {
        category: c.GA_EVENT_CATEGORY_VC,
        action: c.GA_EVENT_ACTION_VC_INFO_PANEL_DURATION,
        label: actions.getVideoId(),
        value: Date.now() - this.timeShowed,
      });

      // Prevent the info-panel open time to be used again
      this.timeShowed = undefined;
    }

    // Show/hide the info panel
    this.setState((prevState) => ({
      showPanel: !prevState.showPanel,
    }));
  };

  // Bang
  execute(key) {
    const { content } = this.props;

    Logger.info(`+ InfoPanelVC executed: ${key}`);
    Logger.info(`  Getting content from ${content}`);

    this.setState({ display: true });
  }

  // If this interactive video component were to render something, do it here
  render() {
    const { content, side, iconShow, iconHide, styles } = this.props;
    const { display, showPanel } = this.state;

    const iconWidth = (styles && styles.icon && styles.icon.default && styles.icon.default.width) || "10%";
    const panelWidth = (styles && styles.panel && styles.panel.default && styles.panel.default.width) || "33%";

    // Control the animated sliding depending on whether the panel is on the
    // left or the right side
    let cssForSide = {
      transform: `translateX(calc(${panelWidth} - ${iconWidth} / 2))`,
    };
    if (side === "left") {
      cssForSide = {
        transform: `translateX(calc(-${panelWidth} + ${iconWidth} / 2))`,
      };
    }

    return (
      display && (
        <div className="info-panel-wrapper">
          <div className={`holder ${showPanel ? "show-panel" : "hide-panel"}`} style={!showPanel ? cssForSide : {}}>
            <Panel content={content} side={side} styles={styles && styles.panel} />

            <Icon
              onClick={this.handleOnClick}
              image={showPanel ? iconHide : iconShow}
              imageCustomClass={showPanel ? "icon-hide" : "icon-show"}
              panelWidth={panelWidth}
              iconWidth={iconWidth}
              side={side}
              styles={styles && styles.icon}
            />
          </div>
        </div>
      )
    );
  }
}
